import React from 'react';
import './App.css';
import { Switch, Route } from "react-router-dom"
import Header from './components/Header'
import "./styles.css"

function App() {


  return (
    <div>
      <Header />
      <Switch>
                <Route exact path="/">
                    <Photos />
                </Route>

                <Route path="/cart">
                    <Cart />
                </Route>
            </Switch>
      <h1>Hello World!</h1>
    </div>
  );
}

export default App;
